    return(
        <div id={`dropDown${turn}`}>
            <div id={hidePhone}>
                <h1 id="phoneTitle">Contact Info</h1>
                <h3 id="phoneNumber">Phone Number: (602) 432-6806</h3>
                <div id={hidePhoneSpace}></div>
                <h3 id="email">Email: Bobby.deluna2@gmail.com</h3>
            </div>

            <div id={hideSoc}>
                <h1 id="socialTitle">Socials</h1>
                    <div onClick="location.https://www.linkedin.com/in/robert-de-luna-9b9691165/" id={atDrop} rel="noreferrer" target="_blank">Linkedin</div>
                    <div id={socSpace}></div>
                    <a id={atDrop} rel="noreferrer" href="https://github.com/Hushtonebob" target="_blank">GitHub</a>
                    <div id={socSpace}></div>
                    <a id={atDrop} rel="noreferrer" href="https://www.instagram.com/hushtonebob/" target="_blank">Instagram</a>     
            </div>           
        </div>
    )

//end of component
};

export default DropDown;
